import React, { Component } from "react";
import { connect } from "react-redux";
import { login, userIdOnChnage } from "../actions";
class Login extends Component {
  state = {};

  componentDidMount() {
    console.log("Login did mount  this.props", this.props);
  }
  render() {
    return (
      <div className="loginRoot">
        <label>
          UserId
          <input
            type="text"
            name="userId"
            value={this.props.userId}
            onChange={e => {
              this.props.userIdOnChnage(this.props.userId);
            }}
          />
        </label>
        <label>
          {" "}
          Password
          <input type="password" name="password" />
        </label>
        <br />
        <input type="submit" value="click" />
      </div>
    );
  }
}
const mapStateToProps = state => {
  console.log("[State Login component]", state.authentication);
  return state.authentication;
};
export default connect(
  mapStateToProps,
  { login, userIdOnChnage }
)(Login);
